import { Container } from '@material-ui/core';
import BodyStyle from './body.style';
import useWindowDimensions from '../utils/screen';

function Body() {
  const styles = BodyStyle();
  const { height} = useWindowDimensions();

  return (
      <Container  className={styles.body}>

      </Container>
  );
}

export default Body;
